import './App.css';
import React, {Component} from "react";
import {Link, Navigate} from "react-router-dom";
class AddLocation extends Component {
    constructor(props) {
        super(props);
        this.state = {name:'',address:'',description:'',hours:'',error:false,countries:[],country:''};
        this.handleAddLocation = this.handleAddLocation.bind(this);
        this.handleChangeName=this.handleChangeName.bind(this);
        this.handleChangeDescription=this.handleChangeDescription.bind(this);
        this.handleChangeAddress=this.handleChangeAddress.bind(this);
        this.handleChangeHours=this.handleChangeHours.bind(this);
        this.handleAddCountry = this.handleAddCountry.bind(this);
    }

    async componentDidMount() {
        const token = localStorage.getItem("jwt")
        const requestOptions = {
            method: 'GET',
            headers:{   'Content-Type': 'application/json',
                        'Authorization': `Bearer ${token}`
            }
        };
        fetch('http://localhost:8080/addlocation',requestOptions)
            .then(async response=>{
                if(response.status===403 || response.status===401){
                    this.setState({error: true});
                }else {
                    const d = await response.json();
                    this.setState({countries: d});
                    console.log(this.state.countries)
                }
            })
    }

    handleChangeName(event) {
        this.setState({name: event.target.value});
    }
    handleChangeDescription(event) {
        this.setState({description: event.target.value});
    }
    handleChangeAddress(event) {
        this.setState({address: event.target.value});
    }
    handleChangeHours(event) {
        this.setState({address: event.target.value});
    }
    handleAddLocation(event){

    }
    handleAddCountry(event) {
        let e = document.getElementById("countries");
        let value = e.options[e.selectedIndex].value;
        console.log(value)
        this.setState({country: value});
    }
